  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Fish and Wildlife Service
  has proposed to establish a Nulhegan Basin Division of the Silvio 0. Conte National
  Fish and Wildlife Refuge to provide long-term protection for important migratory
  bird habitat, habitat for rare species and plant communities, important fisheries
  habitat, and valuable wetlands. This Final Environmental Assessment and its supporting
  documents describe a vision for long-term protection of important habitat and the
  species in and around the Nulhegan Basin. Land protection in this area will safeguard
  the important biological resources the Service recognized when it designated this
  area as a high priority Special Focus Area in the Refuge Draft and Final Environmental
  Impact Statements.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
